import {
    SET_CURRENT_USER_NULL,
    SET_CURRENT_USER
} from './types'



//set user null
export const setCurrentUserNull = user => ({
    type: SET_CURRENT_USER_NULL
  });

export const setCurrentUser = user => ({
    type: SET_CURRENT_USER,
    payload: user
  });
